import React from "react";

export const Exchanges = ({ exchange }) => {
  const { name, description, links } = exchange;

  return (
    <div>
      {`${name} ${description} ${
        links.website ? links.website[0] : links.twitter[0]
      }`}
    </div>
  );
};
